import Sidebar from "../components/Sidebar";
import Header from "../components/Header";
import styled from "styled-components";

const ChatSetting = () => {
  return (
    <>
      <Header />
      <Sidebar />
      <div>채팅방 페이지</div>
    </>
  );
};

export default ChatSetting;

const InputWrapper = styled.div`
  max-width: 1000px;
  text-align: center;
  margin: 30px auto`;

const NavWrapper = styled.div`
 padding-top : 150px;
`;
